import React, { Component } from 'react';
import {UserConsumer} from '../user';

class User extends Component {
    constructor(props){
        super(props);
        this.state = {
            url : 'https://jsonplaceholder.typicode.com/users',
            user :[],
        }
    }

    componentDidMount=() => {

        fetch(this.state.url)
        .then(result =>{
            // result.
            console.log(result.json());
        })

    }

    render() {
        return (
          <div>
              {
                  this.state.user && this.state.user.length > 0 && this.state.user.map((user,index)=>{
                      return(
                          <div>
                              user.name
                          </div>
                      )
                  })
              }
          </div>
        );
    }
}

export default User;
